<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Challan Generator</title>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
  <script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
  <script src="https://html2canvas.hertzen.com/dist/html2canvas.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf-autotable/3.5.23/jspdf.plugin.autotable.min.js"></script>
  <style>
    body {
      background: #f0f2f5;
      font-family: 'Segoe UI', sans-serif;
    }
    .container {
      background: white;
      padding: 20px;
      border-radius: 10px;
      margin-top: 30px;
      box-shadow: 0 0 15px rgba(0,0,0,0.1);
    }
    h2 {
      text-align: center;
      margin-bottom: 20px;
    }
    .total-box, .words-box {
      margin-top: 20px;
      font-weight: bold;
    }
    .gst-box {
      margin-top: 20px;
    }
    .terms-box {
      margin-top: 30px;
    }
  </style>
</head>
<body>
<div class="container">
  <h2>Sneh Trades Challan</h2>
  <form id="challanForm">
    <div class="mb-3">
      <label for="challanNo" class="form-label">Challan Number</label>
      <input type="text" class="form-control" id="challanNo" required>
    </div>
    <div class="mb-3">
      <label for="challanDate" class="form-label">Select Date</label>
      <input type="date" class="form-control" id="challanDate" required>
    </div>
    <div class="mb-3">
      <label for="partySelect" class="form-label">Select Party</label>
      <select class="form-select" id="partySelect" required>
        <option value="">Choose...</option>
        <option value="Party A" data-gst="27AAHCP1234A1Z5" data-address="Mumbai, Maharashtra">Party A</option>
        <option value="Party B" data-gst="29AABCU5678L1Z2" data-address="Bangalore, Karnataka">Party B</option>
      </select>
    </div>
    <div class="mb-3">
      <label for="partyGST">GST Number</label>
      <input type="text" class="form-control" id="partyGST" readonly>
    </div>
    <div class="mb-3">
      <label for="partyAddress">Address</label>
      <input type="text" class="form-control" id="partyAddress" readonly>
    </div>
    <div class="mb-3">
      <label for="numItems">Number of Products</label>
      <input type="number" class="form-control" id="numItems" min="1" required>
    </div>
    <div id="productsSection"></div>
    <div class="total-box">
      Total Amount (Excl. GST): ₹<span id="totalAmount">0</span>
    </div>
    <div class="gst-box" id="gstOptions"></div>
    <div class="total-box">
      Final Amount (Incl. GST): ₹<span id="finalAmount">0</span>
    </div>
    <div class="words-box">
      In Words: <span id="amountWords">Zero</span>
    </div>
    <div class="terms-box">
      <strong>Terms & Conditions:</strong>
      <ul>
        <li>Goods once sold will not be taken back.</li>
        <li>Payment should be made within 15 days.</li>
        <li>Subject to jurisdiction only.</li>
        <li>Ensure goods received in proper condition.</li>
      </ul>
    </div>
    <button type="submit" class="btn btn-primary mt-4">Generate PDF</button>
  </form>
  <img id="signatureImage" src="DJSCE_Logo.png" alt="Signature" style="display:none;">
</div>


<script>
const gstRates = { '6': 0.06, '9': 0.09, '18': 0.18 };
const partySelect = document.getElementById('partySelect');
const partyGST = document.getElementById('partyGST');
const partyAddress = document.getElementById('partyAddress');
const numItems = document.getElementById('numItems');
const productsSection = document.getElementById('productsSection');
const totalAmountSpan = document.getElementById('totalAmount');
const finalAmountSpan = document.getElementById('finalAmount');
const amountWordsSpan = document.getElementById('amountWords');
const gstOptions = document.getElementById('gstOptions');
let totalExclGST = 0;

partySelect.addEventListener('change', () => {
  const selectedOption = partySelect.selectedOptions[0];
  const gstNumber = selectedOption.getAttribute('data-gst');
  const address = selectedOption.getAttribute('data-address');
  partyGST.value = gstNumber;
  partyAddress.value = address;
  renderGstDropdown(gstNumber);
});

function renderGstDropdown(gstNumber) {
  gstOptions.innerHTML = '';
  if (gstNumber.startsWith('27')) {
    gstOptions.innerHTML = `
      <label>GST Options:</label>
      <div class="row">
        <div class="col-md-6">
          <select id="cgstSelect" class="form-select">
            <option value="6">6%</option>
            <option value="9">9%</option>
          </select>
        </div>
        <div class="col-md-6">
          <select id="sgstSelect" class="form-select">
            <option value="6">6%</option>
            <option value="9">9%</option>
          </select>
        </div>
      </div>
    `;
  } else {
    gstOptions.innerHTML = `
      <label>IGST Option:</label>
      <select id="igstSelect" class="form-select">
        <option value="18">18%</option>
      </select>
    `;
  }
  document.getElementById('cgstSelect')?.addEventListener('change', updateTotals);
  document.getElementById('sgstSelect')?.addEventListener('change', updateTotals);
  document.getElementById('igstSelect')?.addEventListener('change', updateTotals);
  updateTotals();
}

numItems.addEventListener('input', () => {
  productsSection.innerHTML = '';
  const count = parseInt(numItems.value);
  const table = document.createElement('table');
  table.className = 'table table-bordered';
  table.innerHTML = `<thead><tr><th>Sr No</th><th>Product Name</th><th>HSN Code</th><th>Qty</th><th>Rate</th><th>Amount</th></tr></thead><tbody></tbody>`;
  const tbody = table.querySelector('tbody');
  for (let i = 0; i < count; i++) {
    const row = document.createElement('tr');
    row.innerHTML = `
      <td>${i + 1}</td>
      <td><input type="text" class="form-control" name="productName" required></td>
      <td><input type="text" class="form-control" name="hsnCode" required></td>
      <td><input type="number" class="form-control qty" name="qty" required></td>
      <td><input type="number" class="form-control netAmount" name="netAmount" required></td>
      <td class="text-end">₹<span class="amount">0</span></td>
    `;
    tbody.appendChild(row);
  }
  productsSection.appendChild(table);
  attachChangeListeners();
});

function attachChangeListeners() {
  const netAmounts = document.querySelectorAll('.netAmount');
  const qtyInputs = document.querySelectorAll('.qty');
  netAmounts.forEach(input => input.addEventListener('input', updateTotals));
  qtyInputs.forEach(input => input.addEventListener('input', updateTotals));
}

function updateTotals() {
  const productRows = document.querySelectorAll('#productsSection tbody tr');
  let total = 0;
  productRows.forEach(row => {
    const qty = parseFloat(row.querySelector('.qty').value) || 0;
    const net = parseFloat(row.querySelector('.netAmount').value) || 0;
    const amount = qty * net;
    row.querySelector('.amount').textContent = amount.toFixed(2);
    total += amount;
  });
  totalExclGST = total;
  totalAmountSpan.textContent = total.toFixed(2);

  let gstTotal = 0;
  const gstNo = partyGST.value;
  if (gstNo.startsWith('27')) {
    const cgstRate = gstRates[document.getElementById('cgstSelect')?.value] || 0;
    const sgstRate = gstRates[document.getElementById('sgstSelect')?.value] || 0;
    gstTotal = total * (cgstRate + sgstRate);
  } else {
    const igstRate = gstRates[document.getElementById('igstSelect')?.value] || 0;
    gstTotal = total * igstRate;
  }
  const finalAmt = total + gstTotal;
  finalAmountSpan.textContent = finalAmt.toFixed(2);
  amountWordsSpan.textContent = numberToWords(finalAmt);
}

function numberToWords(amount) {
  const a = ["", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten", "Eleven", "Twelve", "Thirteen", "Fourteen", "Fifteen", "Sixteen", "Seventeen", "Eighteen", "Nineteen"];
  const b = ["", "", "Twenty", "Thirty", "Forty", "Fifty", "Sixty", "Seventy", "Eighty", "Ninety"];
  const numberToWordsHelper = n => {
    if (n < 20) return a[n];
    if (n < 100) return b[Math.floor(n / 10)] + (n % 10 ? " " + a[n % 10] : "");
    if (n < 1000) return a[Math.floor(n / 100)] + " Hundred " + numberToWordsHelper(n % 100);
    return numberToWordsHelper(Math.floor(n / 1000)) + " Thousand " + numberToWordsHelper(n % 1000);
  };
  return numberToWordsHelper(Math.floor(amount)) + " Rupees Only";
}

document.getElementById('challanForm').addEventListener('submit', function (e) {
  e.preventDefault();

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  // Company Details
  let yOffset = 35;
  doc.setFontSize(30);
  doc.text("SNEH TRADES", 105, yOffset, null, null, 'center');
  yOffset += 8;
  doc.setFontSize(12);
  doc.text("D/314, Kamala Ashish 3, Mahavir Nagar, kandivali(W), Mumbai - 400067", 105, yOffset, null, null, 'center');
  yOffset += 6;
  doc.text("Email: snehtrades@gmail.com | Mobile: 9821912646", 105, yOffset, null, null, 'center');
  yOffset += 13;

  // Buyer + Challan Info
  const challanNo = document.getElementById('challanNo').value;
  const challanDate = document.getElementById('challanDate').value;
  const partyName = document.getElementById('partySelect').value;
  const partyGST = document.getElementById('partyGST').value;
  const partyAddress = document.getElementById('partyAddress').value;

  doc.setFontSize(12);
  doc.text(`Buyer: ${partyName}`, 15, yOffset);
  doc.text(`Challan No: ${challanNo}`, 150, yOffset);
  yOffset += 7;
  doc.text(`Address: ${partyAddress}`, 15, yOffset);
  doc.text(`Date: ${challanDate}`, 150, yOffset);
  yOffset += 7;
  doc.text(`GST No: ${partyGST}`, 15, yOffset);
  yOffset += 10;

  // Table
  const productRows = Array.from(document.querySelectorAll('#productsSection tbody tr')).map((row, index) => {
    const name = row.querySelector('[name="productName"]').value;
    const hsn = row.querySelector('[name="hsnCode"]').value;
    const qty = row.querySelector('[name="qty"]').value;
    const rate = row.querySelector('[name="netAmount"]').value;
    const amount = (parseFloat(qty || 0) * parseFloat(rate || 0)).toFixed(2);
    return [
      (index + 1).toString(),
      name,
      hsn,
      qty,
      rate,
      amount
    ];
  });

  doc.autoTable({
    startY: yOffset,
    head: [['Sr No', 'Product Name', 'HSN Code', 'Qty', 'Rate', 'Amount']],
    body: productRows,
    styles: {
      halign: 'left',
      lineColor: [0, 0, 0],
      lineWidth: 0.3,
      textColor: [0, 0, 0]
    },
    theme: 'grid',
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: [0, 0, 0],
      lineColor: [0, 0, 0],
      lineWidth: 0.5,
      fontStyle: 'bold'
    },
    margin: { left: 15, right: 15 }
  });

  yOffset = doc.lastAutoTable.finalY + 10;

  // Totals
  const totalExclGST = parseFloat(document.getElementById('totalAmount').textContent);
  const finalAmt = parseFloat(document.getElementById('finalAmount').textContent);
  const words = document.getElementById('amountWords').textContent;

  const gstNo = document.getElementById('partyGST').value;
  let gstDetails = '';
  doc.setFontSize(12);
  if (gstNo.startsWith('27')) {
    const cgst = parseFloat(document.getElementById('cgstSelect')?.value || 0);
    const sgst = parseFloat(document.getElementById('sgstSelect')?.value || 0);
    gstDetails = `CGST (${cgst}%): ${(totalExclGST * (cgst / 100)).toFixed(2)}\nSGST (${sgst}%): ${(totalExclGST * (sgst / 100)).toFixed(2)}`;
  } else {
    const igst = parseFloat(document.getElementById('igstSelect')?.value || 0);
    gstDetails = `IGST (${igst}%): ${(totalExclGST * (igst / 100)).toFixed(2)}`;
  }

  // Right-aligned totals
  doc.setFontSize(12);
  const rightX = 177;
  doc.text(`Total (Excl. GST): ${totalExclGST.toFixed(2)}`, 190, yOffset, { align: 'right' });
  yOffset += 6;
  gstDetails.split('\n').forEach(line => {
    doc.text(line, rightX, yOffset, { align: 'right' });
    yOffset += 6;
  });
  doc.text(`Total (Incl. GST): ${finalAmt.toFixed(2)}`, 189, yOffset, { align: 'right' });

  // Amount in words
  yOffset += 10;
  doc.setFontSize(12);
  doc.text(`Amount in Words: ${words}`, 15, yOffset);

  // Terms & Conditions
  yOffset += 10;
  doc.setFontSize(11);
  doc.text("Terms & Conditions:", 15, yOffset);
  const terms = [
    "1. Goods once sold will not be taken back.",
    "2. Payment should be made within 15 days.",
    "3. Subject to jurisdiction only.",
    "4. Ensure goods received in proper condition."
  ];
  terms.forEach((term, index) => {
    doc.text(term, 20, yOffset + 6 + (index * 6));
  });

  // Signature image (base64 format recommended)
